interface User {
	id: number,
	email: string,
	firstName?: string,
	lastName?: string,
	userName?: string,
}

function GetAllUsers(): User[] {

	let users: User;
	// const [name, setName] = useState<string | null>(null);

	axios.get('http://localhost:3001/user')
	.then(response => {
		console.log('Checking response...')
		console.log(response.data);
	});

}

const App:React.FC = () =>
{
	return (
		<div>
			<h1>Hello world!</h1>
			{GetAllUsers()}
		</div>
		);
}

export default App;
